INSERT INTO `estatico` (`id`, `idsecao`, `pertencea`, `titulo`, `metatags`, `keywords`, `conteudo`, `ativo`, `data`) VALUES
(1, 1, NULL, 'Quem Somos', 'teste                                                                                                                                                ', 'teste                                                                                                                                                ', '<p align="justify">\r\n	Fundada em 1975, em Vit&oacute;ria, Esp&iacute;rito Santo, a METRON Engenharia cresceu de forma segura e progressiva, alicer&ccedil;ada em valores essenciais: seriedade, efici&ecirc;ncia e qualidade.</p>\r\n<p align="justify">\r\n	Presente no mercado h&aacute; mais de 36 anos, a METRON construiu um nome que &eacute; sin&ocirc;nimo de tradi&ccedil;&atilde;o, solidez e credibilidade. Sua atua&ccedil;&atilde;o abrange a realiza&ccedil;&atilde;o de incorpora&ccedil;&otilde;es imobili&aacute;rias e a constru&ccedil;&atilde;o civil em geral.</p>\r\n<p align="justify">\r\n	O seu elevado conceito empresarial foi conquistado atrav&eacute;s da execu&ccedil;&atilde;o de 1.348.278 m&sup2; de obras e no cumprimento rigoroso dos seus compromissos contratuais. Uma experi&ecirc;ncia consolidada pela entrega de mais de 16.178 im&oacute;veis.</p>\r\n<p align="justify">\r\n	Conta com um quadro de profissionais altamente qualificados, habituados a enfrentar desafios e empenhados no aprimoramento constante da qualidade e na plena satisfa&ccedil;&atilde;o dos clientes.</p>\r\n<br />\r\n<h2>\r\n	Empresas Coligadas</h2>\r\n<p>\r\n	<img alt="" src="http://img137.imageshack.us/img137/1540/empresascoligadas.png" /></p>\r\n', 's', '2012-05-25'),
(2, 2, NULL, 'Prêmios e Certificados', '                                                      ', '                                                      ', '<table border="0" cellpadding="0" cellspacing="3" width="100%">\r\n	<tbody>\r\n		<tr>\r\n			<td align="center" height="80" width="33%">\r\n				<img height="91" src="http://www.metronengenharia.com.br/img/selo_premio_ademi_2009.jpg" width="180" /></td>\r\n			<td align="center" height="80" width="33%">\r\n				<img height="91" src="http://www.metronengenharia.com.br/img/premio_ademi2007.jpg" width="91" /></td>\r\n			<td align="center" height="80" width="33%">\r\n				<img height="107" src="http://www.metronengenharia.com.br/img/premio_colibri.jpg" width="91" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align="center">\r\n				<p>\r\n					Empresa Empreendedora Destaque do Setor Imobili&aacute;rio<br />\r\n					Premio Destaque ADEMI-ES 2009</p>\r\n			</td>\r\n			<td align="center">\r\n				<p>Melhor Construtora Incorporadora 2005/2006<br />\r\n				Pr&ecirc;mio Destaque ADEMI-ES 2007</p></td>\r\n			<td align="center"><p>\r\n				2002 &ndash; Empresa do Ramo Imobili&aacute;rio do Ano<br />\r\n				Trof&eacute;u Colibri &ldquo;Glaucis Hirsuta&rdquo;<br />\r\n				CRECI-ES 13&ordf; Regi&atilde;o</p></td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n<p>\r\n	&nbsp;</p>\r\n', 's', '2012-05-25'),
(3, 3, NULL, 'Sustentabilidade e Responsabilidade Social', '                                                                                          ', '                                                                                          ', '<div style="PADDING-LEFT: 10px; WIDTH: 233px; FLOAT: left; CLEAR: both">\n	<img alt="" src="http://img337.imageshack.us/img337/8523/globalq.png" /></div>\n<p>\n	<span style="color:#990000;"><span style="text-align: left; font-family: Arial,Helvetica,sans-serif; font-size: 16px; font-weight: bold; text-decoration: none;">O que &eacute; sustentabilidade?</span></span><br />\n	<br />\n	Sustentabilidade &eacute; um conceito sist&ecirc;mico, relacionado com a continuidade dos aspectos econ&ocirc;micos, sociais, culturais e ambientais da sociedade humana.<br />\n	<br />\n	Prop&otilde;e-se a ser um meio de configurar a civiliza&ccedil;&atilde;o e atividade humanas, de tal forma que a sociedade, os seus membros e as suas economias possam preencher as suas necessidades e expressar o seu maior potencial no presente, e ao mesmo tempo preservar a biodiversidade e os ecossistemas naturais, planejando e agindo de forma a atingir pr&oacute;-efici&ecirc;ncia na manuten&ccedil;&atilde;o indefinida desses ideais.<br />\n	<br />\n	A sustentabilidade abrange v&aacute;rios n&iacute;veis de organiza&ccedil;&atilde;o, desde a vizinhan&ccedil;a local at&eacute; o planeta inteiro.</p>\n', 's', '2012-06-21'),
