INSERT INTO `noticias` (`idnoticias`, `titulo`, `texto`, `data`, `fonte`, `ativo`) VALUES
(1, 'Metron Engenharia leva 450 imóveis econômicos para o Feirão da Caixa', '<p align="justify">\r\n	O famoso trio &ldquo;bom, bonito e barato&rdquo; &eacute; o perfil que define os im&oacute;veis que a Metron Engenharia est&aacute; preparando para levar at&eacute; o 8&ordm; Feir&atilde;o da Caixa, que vai acontecer entre os dias 18 e 20 de maio, no estacionamento do Shopping Vit&oacute;ria. Ser&atilde;o 450 unidades no perfil &ldquo;Minha casa, minha vida&rdquo;.<br />\r\n	Entre os produtos est&aacute; o mais novo lan&ccedil;amento da empresa, o Via Flora, que re&uacute;ne tr&ecirc;s torres, com 95 unidades de dois quartos e varanda em Jardim Limoeiro. O lazer do Via Flora contempla toda a fam&iacute;lia, com sal&atilde;o de festas, piscina, play infantil e churrasqueiras. As unidades custam a partir de R$ 114.316,00 mil.<br />\r\n	Quem deseja morar perto do mar e investir pouco poder&aacute; comprar uma unidade do Solar de Jacara&iacute;pe, empreendimento localizado na praia mais conhecida da Serra, Jacara&iacute;pe, e que j&aacute; est&aacute; pronto para morar.<br />\r\n	Com estrutura de dois quartos, o empreendimento vai agradar o p&uacute;blico do Feir&atilde;o da Caixa. S&atilde;o 8,6 mil metros quadrados de &aacute;rea e lazer com piscina, sal&atilde;o de festas e churrasqueira, tudo isso com unidades por a partir de R$ 95.219,00 mil.<br />\r\n	Os visitantes do evento que optarem por morar em Vila Velha tamb&eacute;m ter&atilde;o no estande da Metron uma &oacute;tima op&ccedil;&atilde;o de apartamento. O Solar da Vila fica localizado pr&oacute;ximo ao Makro, em Ata&iacute;de, e tem quatro torres de 95 apartamentos cada. Ao todo, s&atilde;o 380 unidades de dois quartos com varanda e lazer com piscina, playground, churrasqueiras, pomar, pra&ccedil;as, v&ocirc;lei de praia e sal&atilde;o de festas. As unidades custam a partir de R$ 112.644,00.<br />\r\n	&ldquo;Estamos muito confiantes nos bons neg&oacute;cios que vamos fechar no Feir&atilde;o da Caixa. No evento, vamos apresentar condi&ccedil;&otilde;es facilitadas e superdescontos para fechamento somente durante os tr&ecirc;s dias&rdquo;, conta Camila Menezes, diretora da Empar, empresa de vendas do Grupo Metron.<br />\r\n	<br />\r\n	Conhe&ccedil;a os empreendimentos:<br />\r\n	<br />\r\n	Solar da Vila - Minha casa, Minha vida<br />\r\n	Constru&ccedil;&atilde;o: Metron Engenharia<br />\r\n	Localiza&ccedil;&atilde;o: pr&oacute;ximo ao Makro, em Ata&iacute;de - Vila Velha<br />\r\n	Torres: quatro torres de 95 apartamentos cada<br />\r\n	Total: 380 unidades<br />\r\n	Quartos: dois quartos com varanda<br />\r\n	Lazer completo: lazer com piscina, playground, churrasqueiras, pomar, pra&ccedil;as, v&ocirc;lei de praia e sal&atilde;o de festas<br />\r\n	Valor: a partir de R$ 112.644,00<br />\r\n	Contato: 3134-6800<br />\r\n	<br />\r\n	SOLAR DE JACARA&Iacute;PE &ndash; Pronto para morar &ndash; Minha casa, Minha vida<br />\r\n	Constru&ccedil;&atilde;o: Metron Engenharia<br />\r\n	Localiza&ccedil;&atilde;o: Rua Santa L&uacute;cia com a rua Caramuru, centro de Jacara&iacute;pe, Serra<br />\r\n	Quartos: dois<br />\r\n	&Aacute;rea total: 8,6 mil metros quadrados<br />\r\n	Lazer: Piscina / Sal&atilde;o de Festas / Churrasqueira<br />\r\n	Estrutura: Vaga de garagem / Elevador / &Aacute;rea Gramada<br />\r\n	Valor: Unidades a partir de R$ 95.219,00<br />\r\n	Vendas: 3134-6800<br />\r\n	<br />\r\n	Via Flora &ndash; cadastro de reserva - Minha casa, Minha vida<br />\r\n	Constru&ccedil;&atilde;o: Metron Engenharia<br />\r\n	Local: Rua Cicilano Ramos, Jardim Limoeiro, Serra<br />\r\n	&Aacute;rea do apto: at&eacute; 48,08 m&sup2;<br />\r\n	Total de apartamentos: 285 unidades<br />\r\n	Total de torres: 03 torres, com 95 unidades cada<br />\r\n	Quartos: 2 quartos<br />\r\n	Lazer: piscina, sal&atilde;o de festas, playground e churrasqueiras<br />\r\n	Garagem: uma vaga<br />\r\n	Vendas: Empar - 3134-6800</p>\r\n', '2012-05-18', 'Metron', 's'),
(2, 'Obras do Brise começam no primeiro semestre', '<p align="justify">\r\n	O primeiro semestre do ano marca o in&iacute;cio das obras do Brise Residence, empreendimento que a Metron Engenharia vai construir em um dos melhores pontos de Guarapari, de frente para o mar da Praia da Cerca, ao final da Praia do Morro.<br />\r\n	Lan&ccedil;ado no in&iacute;cio do ano, o Brise conta com in&uacute;meros diferenciais, como apartamentos amplos, localiza&ccedil;&atilde;o privilegiada e lazer interno com op&ccedil;&otilde;es para toda a fam&iacute;lia, al&eacute;m de espa&ccedil;os para reunir amigos para confraterniza&ccedil;&otilde;es. Entre as op&ccedil;&otilde;es est&atilde;o piscina, sauna, espa&ccedil;o gourmet com churrasqueira, fitness, espa&ccedil;o kids e cine gourmet.<br />\r\n	Ser&atilde;o apenas quatro apartamentos por andar com &aacute;rea de at&eacute; 123,35 m&sup2;, divididos em tr&ecirc;s quartos com uma su&iacute;te mais uma depend&ecirc;ncia e cada apartamento ter&aacute; duas vagas de garagem.<br />\r\n	No total, ser&atilde;o 96 unidades divididas em duas torres com 12 pavimentos cada e as unidades custam a partir de R$ 385 mil. Os interessados em adquirir um apartamento pode procurar a Metron no telefone 3134-6800.<br />\r\n	<br />\r\n	Conhe&ccedil;a o Brise:<br />\r\n	Constru&ccedil;&atilde;o: Metron Engenharia<br />\r\n	Local: Av. Beira Mar, Praia da Cerca, Guarapari<br />\r\n	&Aacute;rea do apto: at&eacute; 123,35 m&sup2;<br />\r\n	Total de unidades: 96 unidades<br />\r\n	Total de torres: 02 torres<br />\r\n	Pavimentos: cada torre ter&aacute; 12 pavimentos tipo e cada pavimento tipo possui 4 apartamentos, totalizando 48 apartamentos por torre<br />\r\n	Quartos: 3 quartos com uma su&iacute;te, mais depend&ecirc;ncia completa de empregada<br />\r\n	Lazer: piscina, sauna, espa&ccedil;o gourmet com churrasqueira, Fitness, espa&ccedil;o kids e cine gourmet,<br />\r\n	Lojas: o empreendimento ter&aacute; 3 lojas no t&eacute;rreo<br />\r\n	&Aacute;rea total constru&iacute;da: 19.088 m2<br />\r\n	Valor: a partir de R$ 385 mil<br />\r\n	Garagem: 2 vagas<br />\r\n	Contato: 3134-6800</p>\r\n', '2012-05-18', 'metron', 's'),
(3, 'Investimento que atrai investimento', '<p align="justify">\r\n	Impulsionada pelo desenvolvimento, Vila Velha est&aacute; atraindo, cada vez mais, investidores interessados. Em pouco tempo, a cidade mais populosa do estado ir&aacute; receber a infraestrutura de dois shoppings. Um deles, o maior do Estado, ser&aacute; constru&iacute;do pela Metron Engenharia, e, andando pelos mesmos caminhos, est&aacute; o desenvolvimento imobili&aacute;rio.<br />\r\n	Por isso, quem pensa em morar ou investir no munic&iacute;pio deve se antecipar. Cada vez mais, o estoque das construtoras est&aacute; baixando, j&aacute; que a procura por um im&oacute;vel com diferenciais competitivos e em localiza&ccedil;&atilde;o estrat&eacute;gica cresce a cada dia.<br />\r\n	Este &eacute; o caso do edif&iacute;cio Veranno, empreendimento da Metron Engenharia localizado na Praia da Costa que est&aacute; com as &uacute;ltimas unidades &agrave; venda e j&aacute; est&aacute; pronto parar morar.<br />\r\n	O Veranno fica a uma quadra do mar e conta com unidades de tr&ecirc;s quartos com su&iacute;te e &aacute;rea privativa de 92 a 109m&sup2; e o lazer &eacute; composto por itens como piscina adulto e infantil, sal&atilde;o de festas, sauna, fitness, sala de estudos, brinquedoteca, espa&ccedil;o gourmet e churrasqueira, tudo entregue montado e decorado.<br />\r\n	Quem precisa de mais espa&ccedil;o pode tamb&eacute;m adquirir uma cobertura do Veranno. O apartamento tem quatro quartos e amplo espa&ccedil;o interno, ideal para grandes fam&iacute;lias ou para quem tem filhos e deseja ter um home office ou espa&ccedil;os dispon&iacute;veis para visitas.<br />\r\n	As unidades do empreendimento custam a partir de R$ 353 mil. mais informa&ccedil;&otilde;es no 3134-6800.<br />\r\n	<br />\r\n	VERANNO &ndash; pronto para morar<br />\r\n	Construtora: Metron Engenharia<br />\r\n	Endere&ccedil;o: Rua Pernambuco, 120 &ndash; Praia da Costa, Vila Velha/ES<br />\r\n	Quartos: 3 quartos com su&iacute;te<br />\r\n	&Aacute;reas privativas: 92 a 109m&sup2;<br />\r\n	Garagem: 2<br />\r\n	Lazer: Piscina adulto e infantil, sal&atilde;o de festas, sauna, fitness, sala de estudos, brinquedoteca, espa&ccedil;o gourmet, churrasqueira<br />\r\n	Pavimentos: 13 pavimentos / 4 por andar / 4 coberturas<br />\r\n	Valor: a partir de R$ 353.000,00<br />\r\n	Vendas: Empar: 3134-6800</p>\r\n', '2012-05-18', 'metron', 's'),
(4, 'Você sabia...', '<p align="justify">\r\n	...que a Metron Engenharia j&aacute; iniciou as obras do Shopping Vila Velha, o maior do Estado? A &aacute;rea total &eacute; de 170 mil m&sup2;, espa&ccedil;o que permitir&aacute; expans&atilde;o da estrutura comercial, j&aacute; prevista para daqui alguns anos.</p>\r\n', '2012-05-18', 'metron', 's'),
(5, 'Metron Engenharia lança o Via Flora', '<p align="justify">\r\n	Consolidando o sucesso de quatro empreendimentos econ&ocirc;micos lan&ccedil;ados, a Metron Engenharia come&ccedil;a o ano trazendo ao mercado mais um condom&iacute;nio que promete ser sucesso em vendas: o Via Flora, que ser&aacute; lan&ccedil;ado no pr&oacute;ximo dia 31, s&aacute;bado, voltado para um p&uacute;blico que quer pagar pouco e morar em um condom&iacute;nio que re&uacute;na boa localiza&ccedil;&atilde;o, estrutura de lazer e seguran&ccedil;a.<br />\r\n	Ser&atilde;o tr&ecirc;s torres, com 95 unidades de dois quartos e varanda. Quem morar no Via Flora poder&aacute; receber amigos e fam&iacute;lia para festas e reuni&otilde;es no sal&atilde;o de festas do condom&iacute;nio. O espa&ccedil;o &eacute; equipado ainda com piscina, playground e churrasqueiras.<br />\r\n	O empreendimento ser&aacute; constru&iacute;do em Jardim Limoeiro e quem se interessar em adquirir uma unidade poder&aacute; utilizar o subs&iacute;dio do Governo Federal do programa &ldquo;Minha casa, minha vida&rdquo;. O estande e o apartamento decorado ficar&atilde;o abertos em hor&aacute;rio especial nos dias de lan&ccedil;amento: das 9h &agrave;s 18h, no dia 31 deste m&ecirc;s e dia 1&ordm; de abril, s&aacute;bado e domingo, respectivamente.<br />\r\n	&ldquo;J&aacute; temos como experi&ecirc;ncias bem-sucedidas outros quatro empreendimentos nestes moldes, na Serra e em Vila Velha. Por isso, acreditamos que esta obra vai cair no gosto das fam&iacute;lias que ainda n&atilde;o t&ecirc;m o seu apartamento&rdquo;, avalia Camila Menezes, diretora da Empar Incorpora&ccedil;&otilde;es e Vendas, empresa respons&aacute;vel pela comercializa&ccedil;&atilde;o das unidades da construtora.<br />\r\n	Os moradores do Via Flora v&atilde;o contar com apartamentos de at&eacute; 48,08 m&sup2; e vaga de garagem para todas as unidades, sendo algumas cobertas. O edif&iacute;cio ficar&aacute; na Rua Cicilano Ramos, pr&oacute;ximo a ES 010.<br />\r\n	<br />\r\n	Conhe&ccedil;a o Via Flora<br />\r\n	Via Flora &ndash; cadastro de reserva - Minha casa, Minha vida<br />\r\n	Constru&ccedil;&atilde;o: Metron Engenharia<br />\r\n	Local: Rua Cicilano Ramos, Jardim Limoeiro, Serra<br />\r\n	&Aacute;rea do apto: at&eacute; 48,08 m&sup2;<br />\r\n	Total de apartamentos: 285 unidades<br />\r\n	Total de torres: 03 torres, com 95 unidades cada<br />\r\n	Quartos: 2 quartos<br />\r\n	Lazer: piscina, sal&atilde;o de festas, playground, churrasqueiras<br />\r\n	Garagem: uma vaga<br />\r\n	Vendas: Empar - 3134-6800</p>\r\n', '2012-05-18', 'metron', 's'),
(6, 'Construção do Shopping Vila Velha tem a marca Metron', '<p align="justify">\r\n	Em breve, o munic&iacute;pio de Vila Velha vai conhecer o maior centro comercial do Estado, o Shopping Vila Velha. O empreendimento ter&aacute; a marca da Metron Engenharia, que participa de uma joint-venture para a constru&ccedil;&atilde;o do espa&ccedil;o.<br />\r\n	O cons&oacute;rcio chama-se MLI e &eacute; composto, al&eacute;m da Metron, pelas empresas Incospal e Littig. A obra demandar&aacute; recursos na ordem de R$ 180 milh&otilde;es s&oacute; na primeira etapa e vai empregar cerca de duas mil pessoas, direta e indiretamente.<br />\r\n	A Metron Engenharia, al&eacute;m de ser refer&ecirc;ncia na constru&ccedil;&atilde;o de empreendimentos residenciais, j&aacute; imprimiu a sua marca em muitas obras da Grande Vit&oacute;ria, como prestadora de servi&ccedil;os a terceiros, como o Shopping Vit&oacute;ria e a Faculdade Univix.<br />\r\n	&ldquo;Esta ser&aacute; mais uma oportunidade de fazer crescer o nosso portf&oacute;lio. Gostamos de desafios como este e sentimos que, cada vez mais, estamos crescendo no mercado de contrata&ccedil;&atilde;o para obras&rdquo;, conta Luiz Carlos Menezes, presidente da Metron Engenharia.<br />\r\n	<br />\r\n	Conhe&ccedil;a o Shopping Vila Velha:<br />\r\n	Previs&atilde;o de inaugura&ccedil;&atilde;o: segundo semestre de 2013<br />\r\n	Investimento: R$ 520 milh&otilde;es<br />\r\n	Empregos: mil nas obras e seis mil na opera&ccedil;&atilde;o<br />\r\n	&Aacute;rea do terreno: 148.610,63 metros quadrados<br />\r\n	&Aacute;rea bruta loc&aacute;vel: 62.860 metros quadrados<br />\r\n	&Aacute;rea constru&iacute;da: 103.308,74 metros quadrados<br />\r\n	Estrutura: ser&atilde;o 220 lojas sat&eacute;lites, seis lojas &acirc;ncoras, 10 megalojas, 10 salas de cinema, game center com 1.350 mil metros quadrados, pra&ccedil;a de alimenta&ccedil;&atilde;o com 28 opera&ccedil;&otilde;es, servi&ccedil;o de atendimento ao cidad&atilde;o, quatro ag&ecirc;ncias banc&aacute;rias e um hipermercado com 9 mil metros quadrados.<br />\r\n	Estacionamento: 3.359 vagas<br />\r\n	Fluxo: 1,5 milh&atilde;o de consumidores por m&ecirc;s<br />\r\n	Potencial de vendas:R$ 568 milh&otilde;es em 2014<br />\r\n	(Fonte: Jornal A Gazeta)</p>\r\n', '2012-05-18', 'metron', 's'),
(7, 'Mudando a casa gastando pouco', '<p align="justify">\r\n	J&aacute; dizia a m&uacute;sica da banda Los Hermanos que todo Carnaval tem seu fim. Pois, nesta &eacute;poca do ano, ap&oacute;s a passagem do per&iacute;odo de f&eacute;rias, &eacute; hora de dar novos ares ao lar e engana-se quem pensa que &eacute; preciso investir muito. &Eacute; poss&iacute;vel, sim, transformar uma decora&ccedil;&atilde;o gastando pouco.<br />\r\n	Em mar&ccedil;o, chega o outono e as programa&ccedil;&otilde;es de transforma&ccedil;&atilde;o da casa podem come&ccedil;ar desde j&aacute;, adaptando o ambiente para o clima mais frio. Uma boa pedida para trazer o clima da esta&ccedil;&atilde;o &agrave; sala &eacute; mudar a capa das almofadas para uma cor mais escura. Um tom chocolate com detalhes em dourado combina com esta &eacute;poca. Se a sua casa n&atilde;o tem almofadas, que tal experimentar usar este objeto que decora e, ao mesmo tempo, traz conforto?<br />\r\n	Nos quartos, objetos de decora&ccedil;&atilde;o com detalhes envelhecidos combinam com colchas mais escuras. Quem est&aacute; disposto a mudar mais um pouco pode decorar a parede com adesivos que s&atilde;o baratos, de f&aacute;cil aplica&ccedil;&atilde;o e trazem um aspecto moderno e aconchegante ao ambiente.<br />\r\n	No banheiro, d&aacute; pra colocar flores envelhecidas sobre a pia, assim como mudar alguns os objetos que j&aacute; est&atilde;o l&aacute;, como porta-escova e pasta ou outros para op&ccedil;&otilde;es em madeira ou amarronzados. Esta tonalidade combina com o clima fresco e traz eleg&acirc;ncia ao espa&ccedil;o.<br />\r\n	&Eacute; hora de colocar a criatividade em a&ccedil;&atilde;o para levar para dentro de casa um pouquinho de cada esta&ccedil;&atilde;o do ano. Garimpando lojas de decora&ccedil;&atilde;o &eacute; poss&iacute;vel encontrar pe&ccedil;as com pre&ccedil;o baixo e design moderno para a &eacute;poca.</p>\r\n', '2012-05-18', 'metron', 's'),
(8, 'Luxo em Guarapari', '<p align="justify">\r\n	H&aacute; um tempo, o conceito de &ldquo;casa na praia&rdquo; era restrito para quem morava muito longe do litoral. Hoje, os motivos para investir em um segundo im&oacute;vel s&atilde;o muitos, como a possibilidade de sair da rotina nos fins de semana ou a op&ccedil;&atilde;o de morar pr&oacute;ximo ao trabalho e ter momentos de lazer em outro lugar.<br />\r\n	Moradores da Grande Vit&oacute;ria, do interior e at&eacute; de outros Estados que curtem o litoral capixaba j&aacute; podem contar com um empreendimento com caracter&iacute;sticas &uacute;nicas, como localiza&ccedil;&atilde;o privilegiada, &aacute;rea de lazer completa, amplos apartamentos e perto de tudo.<br />\r\n	Trata-se do Brise Residence, lan&ccedil;amento da Metron Engenharia que ter&aacute; 96 unidades com &aacute;rea de at&eacute; 123,35 m&sup2; de frente para o mar, na Praia da Cerca, em Guarapari. O empreendimento ser&aacute; composto por duas torres que abrigar&atilde;o ainda tr&ecirc;s lojas no t&eacute;rreo.<br />\r\n	A &aacute;rea total constru&iacute;da mede mais de 19 mil metros quadrados, espa&ccedil;o que comporta tamb&eacute;m uma piscina, sauna, espa&ccedil;o gourmet com churrasqueira, fitness, espa&ccedil;o kids e cine gourmet. Os apartamentos ter&atilde;o tr&ecirc;s quartos com uma su&iacute;te, mais depend&ecirc;ncia de empregada.<br />\r\n	Cada apartamento ter&aacute; direito a duas vagas de garagem e as unidades custam a partir de R$ 380 mil.</p>\r\n', '2012-05-18', 'metron', 's');
